INSERT INTO `movies` (`id`, `name`, `year`, `runtime`, `releasedate`, `storyline`, `created_at`, `updated_at`) VALUES
('1QW6ZLB2KMO', 'Blacklight', 2022, 124, '2022-02-23', 'Travis Block is a government operative coming to terms with his shadowy past. When he discovers a plot targeting U.S. citizens, Block finds himself in the crosshairs of the FBI director he once helped protect.', '2022-03-05 11:59:41', '2022-03-05 13:47:45'),
('DmZGJg10000', 'Edward Scissorhands', 1990, 105, '1990-12-14', 'In a castle high on top of a hill lives an inventor\'s greatest creation - Edward, a near-complete person. The creator died before he could finish Edward\'s hands; instead, he is left with metal scissors for hands. Since then, he has lived alone, until a kind lady called Peg discovers him and welcomes him into her home. At first, everyone welcomes him into the community, but soon things begin to take a change for the worse.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10001', 'Home Alone', 1990, 102, '1990-11-16', 'It is Christmas time and the McCallister family is preparing for a vacation in Paris, France. But the youngest in the family named Kevin got into a scuffle with his older brother Buzz and was sent to his room which is on the third floor of his house. Then, the next morning, while the rest of the family was in a rush to make it to the airport on time, they completely forgot about Kevin who now has the house all to himself. Being home alone was fun for Kevin, having a pizza all to himself, jumping on his parents\' bed, and making a mess. Then, Kevin discovers about two burglars, Harry and Marv, about to rob his house on Christmas Eve. Kevin acts quickly by wiring his own house with makeshift booby traps to stop the burglars and to bring them to justice.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10002', 'The Godfather: Part III', 1990, 162, '1990-12-20', 'In the midst of trying to legitimize his business dealings in New York City and Italy in 1979, aging Mafia Don Michael Corleone seeks to avow for his sins, while taking his nephew Vincent Mancini under his wing.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10003', 'An American Tail: Fievel Goes West', 1991, 74, '1991-11-22', 'An animated movie where the Mousekewitz family travels west to start a new life.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10004', 'Backdraft', 1991, 137, '1991-05-24', 'Two Chicago firefighter brothers, who don\'t get along, have to work together while a dangerous arsonist is on the loose.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10005', 'Manta, Manta', 1991, 91, '1991-10-03', 'Proud German owners of Opel Manta\'s race the streets against VW\'s and Mercedes. They decide to set up a real race with lots of money involved.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10006', 'My Girl', 1991, 102, '1991-11-27', '1972. Vada Sultenfuss (played by Anna Chlumsky) is an intelligent, bubbly, hypochondriacal 11-year old girl. Her father, Harry (Dan Aykroyd), is a mortician and a widower. Her best friend is Thomas J Sennett (Macaulay Culkin). Then her father hires a new receptionist, Shelly (Jamie Lee Curtis), and life will never be the same again.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10007', 'Point Break', 1991, 122, '1991-11-22', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10008', 'Terminator 2: Judgment Day', 1991, 137, '1991-07-03', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10009', 'The Silence of the Lambs', 1991, 118, '1991-02-14', 'A young FBI cadet must receive the help of an incarcerated and manipulative cannibal killer to help catch another serial killer, a madman who skins his victims.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10010', 'Death Becomes Her', 1992, 104, '1992-12-04', 'When a woman learns of an immortality treatment, she sees it as a way to outdo her long-time rival.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10011', 'Home Alone 2: Lost in New York', 1992, 120, '1992-11-20', 'Kevin McCallister is back. But this time he\'s in New York City with enough cash and credit cards to turn the Big Apple into his very own playground. But Kevin won\'t be alone for long. The notorious Wet Bandits, Harry and Marv, still smarting from their last encounter with Kevin, are bound for New York too, plotting a huge holiday heist! Kevin\'s ready to welcome them with more battery of booby traps the bumbling bandits will never forget!', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10012', 'Lorenzo\'s Oil', 1992, 129, '1992-01-29', 'A boy develops a disease so rare that nobody is working on a cure, so his father decides to learn all about it and tackle the problem himself.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10013', 'Reservoir Dogs', 1992, 99, '1992-01-21', 'When a simple jewelry heist goes horribly wrong, the surviving criminals begin to suspect that one of them is a police informant.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10014', 'Dragon: The Bruce Lee Story', 1993, 120, '2093-05-07', 'The film tells the story of actor and martial artist Bruce Lee.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10015', 'Hocus Pocus', 1993, 96, '2093-07-16', 'A curious youngster moves to Salem, where he struggles to fit in before awakening a trio of diabolical witches that were executed in the 17th century.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10016', 'Jurassic Park', 1993, 127, '1993-06-11', 'Huge advancements in scientific technology have enabled a mogul to create an island full of living dinosaurs. John Hammond has invited four individuals, along with his two grandchildren, to join him at Jurassic Park. But will everything go according to plan? A park employee attempts to steal dinosaur embryos, critical security systems are shut down and it now becomes a race for survival with dinosaurs roaming freely over the island.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10017', 'Dumb and Dumber', 1994, 107, '1994-12-16', 'The cross-country adventures of 2 good-hearted but incredibly stupid friends.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10018', 'Forrest Gump', 1994, 142, '1994-07-06', 'The presidencies of Kennedy and Johnson, Vietnam, Watergate, and other history unfold through the perspective of an Alabama man with an IQ of 75.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10019', 'Little Giants', 1994, 107, '1994-10-14', 'Misfits form their own opposing team to an elite peewee football team, coached by the elite team coach\'s brother.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10020', 'Pulp Fiction', 1994, 178, '1994-10-14', 'The lives of two mob hitmen, a boxer, a gangster and his wife, and a pair of diner bandits intertwine in four tales of violence and redemption.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10021', 'Schindlers List', 1994, 195, '1994-02-04', 'In German-occupied Poland during World War II, Oskar Schindler gradually becomes concerned for his Jewish workforce after witnessing their persecution by the Nazi Germans.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10022', 'Street Fighter', 1994, 102, '1994-12-23', 'Col. Guile and various other martial arts heroes fight against the tyranny of Dictator M. Bison and his cohorts.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10023', 'The Lion King', 1994, 88, '1994-06-15', 'The Lion King tells the story of Simba, a young lion who is to succeed his father, Mufasa, as King of the Pride Lands; however, after Simba\'s uncle Scar (Mufasa\'s jealous younger brother), murders Mufasa, Simba is manipulated into thinking he was responsible and flees into exile. Upon maturation living with two wastrels, Simba is given some valuable perspective from his childhood friend, Nala, and his shaman, Rafiki, before returning to challenge Scar to end his tyranny and take his place in the Circle of Life as the rightful King.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10024', 'The Mask', 1994, 101, '1994-07-29', 'The story of Stanley Ipkiss, an unfortunate bank clerk who finds a magical mask that transforms him into a green-faced superhero.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10025', 'The Shawshank Redemption', 1994, 142, '1993-09-10', 'Two imprisoned men bond over a number of years, finding solace and eventual redemption through acts of common decency.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10026', 'Ghost in the Shell', 1995, 85, '1995-11-18', 'A cyborg policewoman and her partner hunt a mysterious and powerful hacker called the Puppet Master.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10027', 'Hackers', 1995, 107, '1995-09-15', 'A teenage hacker finds himself framed for the theft of millions of dollars from a major corporation. Master hacker Dade Murphy, aka Zero Cool, aka Crash Override, has been banned from touching a keyboard for seven years after crashing over 1,500 Wall Street computers at the age of 11. Now keen to get back in front of a monitor, he finds himself in more trouble than ever.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10028', 'Jumanji', 1995, 104, '1995-12-15', 'When two kids find and play a magical board game, they release a man trapped for decades in it and a host of dangers that can only be stopped by finishing the game.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10029', 'Kicking and Screaming', 1995, 96, '1995-10-06', 'After college graduation, Grover\'s girlfriend Jane tells him she\'s moving to Prague to study writing. Grover declines to accompany her, deciding instead to move in with several friends, all of whom can\'t quite work up the inertia to escape their university\'s pull. Nobody wants to make any big decisions that would radically alter his life, yet none of them wants to end up like Chet, the professional student who tends bar and is in his tenth year of university studies.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10030', 'A Thin Line Between Love and Hate', 1966, 148, '1996-04-03', 'A ladies man of legendary reputation finds himself targeted by one of his obsessed lovers.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10031', 'Happy Gilmore', 1996, 92, '1996-02-16', 'A rejected hockey player puts his skills to the golf course to save his grandmother\'s house.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10032', 'Independence Day', 1996, 145, '1996-06-25', 'The aliens are coming and their goal is to invade and destroy Earth. Fighting superior technology, mankind\'s best weapon is the will to survive.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10033', 'Mission: Impossible', 1996, 110, '1996-05-22', 'An American agent, under false suspicion of disloyalty, must discover and expose the real spy without the help of his organization.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10034', 'Space Jam', 1996, 88, '1996-11-15', 'In a desperate attempt to win a basketball match and earn their freedom, the Looney Tunes seek the aid of retired basketball champion, Michael Jordan.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10035', 'Twister', 1996, 113, '1996-05-17', 'During the approach of the most powerful storm in decades, university professor Dr. Jo Harding (Helen Hunt) and an underfunded team of students prepare the prototype for Dorothy, a ground-breaking tornado data-gathering device conceived by her estranged husband, Bill', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10036', 'Starship Troopers', 1997, 129, '1997-11-07', 'In the distant future, the Earth is at war with a race of giant alien insects. Little is known about the Bugs except that they are intent on the eradication of all human life. But there was a time before the war... A Mobile Infantry travels to distant alien planets to take the war to the Bugs. They are a ruthless enemy with only one mission: Survival of their species no matter what the cost...', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10037', 'The Fifth Element', 1997, 127, '1997-05-09', 'In the colorful future, a cab driver unwittingly becomes the central figure in the search for a legendary cosmic weapon to keep Evil and Mr. Zorg at bay.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10038', 'The Lost World: Jurassic Park', 1997, 129, '1997-05-23', 'Four years after the failure of Jurassic Park on Isla Nublar, John Hammond reveals to Ian Malcolm that there was another island (\"Site B\") on which dinosaurs were bred before being transported to Isla Nublar. Left alone since the disaster, the dinosaurs have flourished, and Hammond is anxious that the world see them in their \"natural\" environment before they are exploited.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10039', 'Armageddon', 1998, 151, '1998-07-01', 'After discovering that an asteroid the size of Texas is going to impact Earth in less than a month, N.A.S.A. recruits a misfit team of deep core drillers to save the planet.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10040', 'American Beauty', 1999, 122, '1999-01-10', 'A sexually frustrated suburban father has a mid-life crisis after becoming infatuated with his daughter\'s best friend.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10041', 'Fight Club', 1999, 139, '1999-10-15', 'A depressed man (Edward Norton) suffering from insomnia meets a strange soap salesman named Tyler Durden (Brad Pitt) and soon finds himself living in his squalid house after his perfect apartment is destroyed. The two bored men form an underground club with strict rules and fight other men who are fed up with their mundane lives. Their perfect partnership frays when Marla (Helena Bonham Carter), a fellow support group crasher, attracts Tyler\'s attention.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10042', 'Pretty Woman', 1999, 119, '1999-03-23', 'A man in a legal but hurtful business needs an escort for some social events, and hires a beautiful prostitute he meets... only to fall in love.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10043', 'Star Wars: Episode I - The Phantom Menace', 1999, 136, '1999-05-19', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10044', 'The Matrix', 1999, 136, '1999-03-31', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10045', 'The Sixth Sense', 1999, 107, '1999-08-02', 'Young Cole Sear (Haley Joel Osment) is haunted by a dark secret: he is visited by ghosts. Cole is frightened by visitations from those with unresolved problems who appear from the shadows. He is too afraid to tell anyone about his anguish, except child psychologist Dr. Malcolm Crowe (Bruce Willis). As Dr. Crowe tries to uncover the truth about Cole\'s supernatural abilities, the consequences for client and therapist are a jolt that awakens them both to something unexplainable.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10046', 'Crouching Tiger, Hidden Dragon', 2000, 120, '2000-05-18', 'The film tells the story of two women, both exquisite fighters, and whose lives are in the days of the Qing Dynasty. Their fates lead them on a violent and startling journey that will force them to make choices that could change their lives.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10047', 'Dude, Where\'s My Car?', 2000, 83, '2000-12-15', 'Two potheads wake up after a night of partying and cannot remember where they parked their car.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10048', 'Finding Forrester', 2000, 136, '2000-12-20', 'A young writing prodigy finds a mentor in a reclusive author.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10049', 'Gladiator', 2000, 155, '2000-05-05', 'Maximus is a powerful Roman general, loved by the people and the aging Emperor, Marcus Aurelius. Before his death, the Emperor chooses Maximus to be his heir over his own son, Commodus, and a power struggle leaves Maximus and his family condemned to death. The powerful general is unable to save his family, and his loss of will allows him to get captured and put into the Gladiator games until he dies. The only desire that fuels him now is the chance to rise to the top so that he will be able to look into the eyes of the man who will feel his revenge.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10050', 'High Fidelity', 2000, 113, '2000-03-11', 'Rob, a record store owner and compulsive list maker, recounts his top five breakups, including the one in progress.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10051', 'Mission: Impossible II', 2000, 123, '2000-05-24', 'A secret agent is sent to Sydney, to find and destroy a genetically modified disease called \"Chimera\".', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10052', 'Remember the Titans', 2000, 113, '2000-09-29', 'The true story of a newly appointed African-American coach and his high school team on their first season as a racially integrated unit.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10053', 'The Replacements', 2000, 118, '2000-08-11', 'During a pro football strike, the owners hire substitute players.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10054', 'X-Men', 2000, 104, '2000-07-14', 'Two mutants come to a private academy for their kind whose resident superhero team must oppose a terrorist organization with similar powers.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10055', 'A Beautiful Mind', 2001, 135, '2001-12-13', 'After John Nash, a brilliant but asocial mathematician, accepts secret work in cryptography, his life takes a turn for the nightmarish.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10056', 'A.I. Artificial Intelligence', 2001, 146, '2001-06-26', 'A highly advanced robotic boy longs to become real so that he can regain the love of his human mother.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10057', 'Hard Ball', 2001, 106, '2001-09-14', 'An aimless young man who is scalping tickets, gambling, and drinking, agrees to coach a Little League team from the Cabrini Green housing project in Chicago as a condition of getting a loan from a friend.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10058', 'Harry Potter and the Sorcerer\'s Stone', 2001, 152, '2001-11-16', 'At Hogwarts School of Witchcraft and Wizardry, Harry embarks on the adventure of a lifetime. He learns the high-flying sport Quidditch and plays a thrilling game with living chess pieces on his way to face a Dark Wizard bent on destroying him.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10059', 'Jay and Silent Bob Strike Back', 2001, 104, '2001-08-24', 'The comic \'Bluntman and Chronic\' is based on real-life stoners Jay and Silent Bob, so when they get no profit from a big-screen adaptation, they set out to wreck the movie.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10060', 'Memento', 2001, 113, '2001-09-05', 'Leonard (Guy Pearce) is tracking down the man who raped and murdered his wife. The difficulty, however, of locating his wife\'s killer is compounded by the fact that he suffers from a rare, untreatable form of memory loss. Although he can recall details of life before his accident, Leonard cannot remember what happened fifteen minutes ago, where he\'s going, or why.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10061', 'Ocean\'s Eleven', 2001, 117, '2001-12-07', 'Danny Ocean, a gangster, assembles a group of eleven people in order to loot three popular casinos owned by Terry Benedict.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10062', 'Spirited Away', 2001, 125, '2001-07-18', 'Spirited Away is an adventure and coming-of-age film in whichthe main character, a young girl by the name of Chihiro, embarks on a quest to save her family from a supernatural spell.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
