('DmZGJg10142', 'Transformers: Revenge of the Fallen', 2009, 150, '2009-06-24', 'Sam Witwicky leaves the Autobots behind for a normal life. But when his mind is filled with cryptic symbols, the Decepticons target him and he is dragged back into the Transformers\' war.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10143', 'Underworld: Rise of the Lycans', 2009, 92, '2006-01-23', 'Viktor (Bill Nighy), the cruel king of the vampires, has persecuted the Lycans for centuries. Young Lycan Lucian (Michael Sheen) rallies his people against Viktor and his Death Dealer warriors. With his secret lover Sonja (Rhona Mitra), a vampire, at his side, Lucian leads the werewolves in a final battle to break free of enslavement -- or die trying.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10144', 'Watchmen', 2009, 215, '2009-02-23', 'In 1985 where former superheroes exist, the murder of a colleague sends active vigilante Rorschach into his own sprawling investigation, uncovering something that could completely change the course of history as we know it.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10145', 'X-Men Origins: Wolverine', 2009, 107, '2009-05-01', 'A look at Wolverine\'s early life, in particular his time with the government squad Team X and the impact it will have on his later years.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10146', 'Due Date', 2010, 95, '2010-11-05', 'Businessman and first time father (to-be), Peter Highman\'s in Atalanta trying to get home to LA, where how wife\'s about to give birth, but after getting kicked off a plane, due to his seat mate, the pair end up trying to hitch a rideto the west coast.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10147', 'Harry Potter and the Deathly Hallows: Part 1', 2010, 146, '2010-11-19', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10148', 'How To Train Your Dragon', 2010, 98, '2010-03-26', 'A hapless young Viking who aspires to hunt dragons becomes the unlikely friend of a young dragon himself, and learns there may be more to the creatures than he assumed.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10149', 'Inception', 2010, 148, '2010-07-16', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10150', 'Iron Man 2', 2010, 124, '2010-05-07', 'With the world now aware of his dual life as the armored superhero Iron Man, billionaire inventor Tony Stark faces pressure from the government, the press, and the public to share his technology with the military. Unwilling to let go of his invention, Stark, along with Pepper Potts, and James \"Rhodey\" Rhodes at his side, must forge new alliances - and confront powerful enemies', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10151', 'Percy Jackson and the Olympians: The Lightning Thi', 2010, 119, '2010-02-02', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10152', 'Red', 2010, 111, '2010-10-15', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10153', 'Resident Evil 4: Afterlife', 2010, 96, '2010-09-17', 'In a world ravaged by a virus infection, turning its victims into the Undead, Alice (Jovovich), continues on her journey to find survivors and lead them to safety. Her deadly battle with the Umbrella Corporation reaches new heights, but Alice gets some unexpected help from an old friend. A new lead that promises a safe haven from the Undead takes them to Los Angeles, but when they arrive the city is overrun by thousands of Undead - and Alice and her comrades are about to step into a deadly trap.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10154', 'The Book of Eli', 2010, 118, '2010-03-18', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10155', 'The Social Network', 2010, 120, '2010-10-01', 'Harvard student Mark Zuckerberg creates a social networking site that would become Facebook and is later sued by two brothers who claimed that Zuckerberg stole their idea and the co-founder who was pushed out of the business', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10156', 'The Tourist', 2010, 103, '2010-12-10', 'Elise (Jolie) sits next to an American tourist, Frank (Depp), on a train going to Venice. She has chosen him as a decoy, making believe that he is her lover who is wanted by police. Not only will they need to evade the police, but also the mobster whose money her lover stole.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10157', 'Captain America: The First Avenger', 2011, 124, '2011-07-22', 'It is 1942, America has entered World War II, and sickly but determined Steve Rogers is frustrated at being rejected yet again for military service. Everything changes when Dr. Erskine recruits him for the secret Project Rebirth. Proving his extraordinary courage, wits and conscience, Rogers undergoes the experiment and his weak body is suddenly enhanced into the maximum human potential. When Dr. Erskine is then immediately assassinated by an agent of Nazi Germany\'s secret HYDRA research department (headed by Johann Schmidt, a.k.a. the Red Skull), Rogers is left as a unique man who is initially misused as a propaganda mascot; however, when his comrades need him, Rogers goes on a successful adventure that truly makes him Captain America, and his war against Schmidt begins.', '2021-12-31 22:00:00', '2021-12-31 22:00:00');
INSERT INTO `movies` (`id`, `name`, `year`, `runtime`, `releasedate`, `storyline`, `created_at`, `updated_at`) VALUES
('DmZGJg10158', 'Fast Five', 2011, 130, '2011-04-29', 'Dominic Toretto and his crew plan to steal $100 million from a corrupt businessman while they are pursued for arrest.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10159', 'Harry Potter and the Deathly Hallows: Part 2', 2011, 130, '2011-07-15', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10160', 'Kung Fu Panda 2', 2011, 90, '2011-05-26', 'Po and his friends fight to stop a peacock villain from conquering China with a deadly new weapon, but first the Dragon Warrior must come to terms with his past.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10161', 'Mission Impossible - Ghost Protocol', 2011, 126, '2011-12-21', 'The IMF is shut down when it\'s implicated in the bombing of the Kremlin, causing Ethan Hunt and his new team to go rogue to clear their organization\'s name.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10162', 'Sherlock Holmes: A Game of Shadows', 2011, 129, '2011-12-16', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10163', 'The Rite', 2011, 114, '2011-01-28', 'The Rite follows skeptical seminary student Michael Kovak, who reluctantly attends exorcism school at the Vatican. While he\'s in Rome, Michael meets an unorthodox priest, Father Lucas (Anthony Hopkins), who introduces him to the darker side of his faith, uncovering the devil\'s reach even to one of the holiest places on Earth.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10164', 'The Rum diary', 2011, 119, '2011-10-28', 'American journalist Paul Kemp (Depp) takes on a freelance job in Puerto Rico for a local newspaper during the 1960s and struggles to find a balance between island culture and the expatriates who live there.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10165', 'Thor', 2011, 115, '2011-05-06', 'The warrior Thor (Hemsworth) is cast out of the fantastic realm of Asgard by his father Odin (Hopkins) for his arrogance and sent to Earth to live among humans. Falling in love with scientist Jane Foster (Portman) teaches Thor much-needed lessons, and his new-found strength comes into play as a villain from his homeland sends dark forces toward Earth.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10166', 'Transformers: Dark of the Moon', 2011, 154, '2011-06-29', 'The Autobots learn of a Cybertronian spacecraft hidden on the moon, and race against the Decepticons to reach it and to learn its secrets.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10167', 'X-Men: First Class', 2011, 132, '2011-06-03', 'In 1962, the United States government enlists the help of Mutants with superhuman abilities to stop a malicious dictator who is determined to start World War III.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10168', 'Django Unchained', 2012, 165, '2012-12-25', 'With the help of a German bounty hunter, a freed slave sets out to rescue his wife from a brutal Mississippi plantation owner.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10169', 'Jack Reacher', 2012, 130, '2012-12-21', 'A homicide investigator digs deeper into a case involving a trained military sniper who shot five random victims.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10170', 'Resident Evil 5: Retribution', 2012, 95, '2012-09-14', 'Alice awakes at home with her daughter Becky and her husband. But soon she realizes that she is actually in an Umbrella Corporation\'s underground facility. Out of the blue, the computer security system shuts-down and Alice flees to the central control room of the facility. She meets Ada Wong, who works with Albert Wesker, and she learns that a five-man team has been sent by Wesker to rescue them. However, the Red Queen sends Jill Valentine and Rain to hunt them down.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10171', 'Silver Linings Playbook', 2012, 122, '2012-12-25', 'After a stint in a mental institution, former teacher Pat Solitano moves back in with his parents and tries to reconcile with his ex-wife. Things get more challenging when Pat meets Tiffany, a mysterious girl with problems of her own.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10172', 'Skyfall', 2012, 143, '2012-11-09', 'Bond\'s loyalty to M is tested when her past comes back to haunt her. When MI6 comes under attack, 007 must track down and destroy the threat, no matter how personal the cost.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10173', 'Stuck in Love', 2012, 97, '2012-05-02', 'An acclaimed writer, his ex-wife, and their teenaged children come to terms with the complexities of love in all its forms over the course of one tumultuous year.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10174', 'The Avengers', 2012, 143, '2012-04-11', 'Nick Fury is the director of S.H.I.E.L.D., an international peace-keeping agency. The agency is a who\'s who of Marvel Super Heroes, with Iron Man, The Incredible Hulk, Thor, Captain America, Hawkeye and Black Widow. When global security is threatened by Loki and his cohorts, Nick Fury and his team will need all their powers to save the world from disaster which is formed by Loki and his team.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10175', 'The Dark Knight Rises', 2012, 164, '2012-07-20', 'Eight years after the Joker\'s reign of anarchy, the Dark Knight, with the help of the enigmatic Catwoman, is forced from his imposed exile to save Gotham City, now on the edge of total annihilation, from the brutal guerrilla terrorist Bane.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10176', 'The Help', 2012, 146, '2012-02-03', 'The film and novel recount the story of young white woman and aspiring journalist Eugenia \'Skeeter\' Phelan. The story focuses on her relationship with two black maids, Aibileen Clark and Minny Jackson, during the Civil Rights Movement in 1963 Jackson, Mississippi.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10177', 'The Hobbit: An Unexpected Journey', 2012, 169, '2012-12-14', 'A reluctant hobbit, Bilbo Baggins, sets out to the Lonely Mountain with a spirited group of dwarves to reclaim their mountain home - and the gold within it - from the dragon Smaug.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10178', 'Underworld: Awakening', 2012, 88, '2012-01-19', 'In the years since she and her human-lycan lover, Michael, defeated Elder Marcus, vampire warrior Selene (Kate Beckinsale) has been taken captive by humans, while they wage an all-out war against both lycans and vampires. Awakening after more than a decade, Selene discovers that Michael is dead, but that she has given birth to his daughter, Eve. Shunned by nearly all surviving vampires, save one (Theo James), even Selene seems powerless against her latest opponent: a genetically enhanced lycan.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10179', 'Coherence', 2013, 89, '2013-09-19', 'Eight friends at a dinner party experience a troubling chain of events due to the malevolent influence of a passing comet.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10180', 'Fast & Furious 6', 2013, 130, '2013-05-24', 'Agent Hobbs cuts a deal with Dominic to clear his crew\'s all criminal records and in return catch a team of mercenaries. During the journey, Dominic unexpectedly meets his presumed-dead lover Letty who is a part of the group.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10181', 'Frozen', 2013, 102, '2013-11-27', 'It is the story of a fearless princess who sets off on a journey alongside a rugged iceman, his loyal reindeer, and a naive snowman to find her estranged sister, whose icy powers have inadvertently trapped their kingdom in eternal winter.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10182', 'G.I. Joe: Retaliation', 2013, 110, '2013-03-28', 'The G.I. Joes are not only fighting their mortal enemy Cobra; they are forced to contend with threats from within the government that jeopardize their very existence.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10183', 'Her', 2013, 126, '2013-10-12', 'In a near future, a lonely writer develops an unlikely relationship with an operating system designed to meet his every need.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10184', 'Iron Man 3', 2013, 130, '2013-05-03', 'After saving New York from an alien invasion, billionaire Tony Stark buries himself deeper into his work by building a ton of new and improved Iron Man suits. He also starts having constant nightmares and doesn\'t know why. But deep in the shadows, a new menace called the Mandarin starts orchestrating a series of terrorist attacks all over the world. When his home is demolished and his suits are destroyed, Stark begins a personal journey to finding out the truth about the bombings and tracking down whoever is truly responsible. Little does Stark know however is that someone else from his past has his own plans against him and proves to be even more powerful than Stark realizes.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10185', 'Man of Steel', 2013, 143, '2013-06-14', 'Clark Kent, one of the last of an extinguished race disguised as an unremarkable human, is forced to reveal his identity when Earth is invaded by an army of survivors who threaten to bring the planet to the brink of destruction.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10186', 'Oldboy', 2013, 104, '2013-11-27', 'After being kidnapped and imprisoned for twenty years, Joe Doucett is released, only to find that he must find his captor in 46 days.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10187', 'Pacific Rim', 2013, 132, '2013-07-12', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10188', 'Percy Jackson: Sea of Monsters', 2013, 106, '2013-08-07', 'In this retelling of Rick Riordans book, The Sea of Monsters, Percy Jackson, accompanied by his friends Annabeth Chase, Clarisse La Rue and Tyson, his half brother, goes on a journey to the Sea of Monsters to retrieve the Golden Fleece and save Camp Half-Blood.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10189', 'Rubinrot', 2013, 122, '2013-03-14', 'Gwendolyn Shepherd is actually a very normal 16-year-old teen. What\'s annoying is that her family definitely has a tad too many secrets. They all have to do with the time-travel gene that is passed down in the family. Everyone is certain that Gwen\'s cousin Charlotte has the gene, and so everything is all Charlotte, all the time. Until the day Gwen, out of the clear blue sky, suddenly finds herself in London at the end of the 19th century. She knows right away that she, and not Charlotte, was born to be a time traveler - even if she could certainly do without it. Just as she could do without Charlotte\'s arrogant boyfriend Gideon de Villiers, with whom she now has to forge an alliance in order to clear up the biggest secret of her family history. One thing is clear: she will do everything possible to solve the ancient mysteries. What isn\'t clear is that one should not fall in love between the times. For that really makes things complicated!', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10190', 'Rush', 2013, 123, '2013-09-27', 'James Hunt and Niki Lauda, two extremely skilled Formula One racers, have an intense rivalry with each other. However, it is their enmity that pushes them to their limits.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10191', 'Star Trek Into Darkness', 2013, 132, '2013-05-16', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10192', 'The Hobbit: The Desolation of Smaug', 2013, 161, '2013-12-13', 'The dwarves, along with Bilbo Baggins and Gandalf the Grey, continue their quest to reclaim Erebor, their homeland, from Smaug. Bilbo Baggins is in possession of a mysterious and magical ring.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10193', 'The Secret Life of Walter Mitty', 2013, 114, '2013-12-25', 'The manager of the negative assets sector of Life magazine, Walter Mitty, has been working for sixteen years for the magazine and has a tedious life, not going anywhere but from his home to his job and vice-versa. He is an escapist, daydreaming into a world of fantasy many times a day. Walter has a crush on the recently hired Cheryl Melhoff but he is too shy to invite her on a date and he is trying to contact her via online dating. The magazine is preparing to release its last printed edition and the loathsome manager of transition Ted Hendricks is preparing an inevitable downsizing over the next few days. Walter has been the liaison between the magazine and the mysterious independent photographer Sean O\'Connell who has sent to him a package of negatives and a wallet as a gift for his work. Sean also suggests to the senior management the use of negative 25 for the cover of the last edition. However, Walter cannot find the negative that is missing. Walter has no means to contact Sean ...', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10194', 'The Wolverine', 2013, 126, '2013-07-26', 'When Wolverine is summoned to Japan by an old acquaintance, he is embroiled in a conflict that forces him to confront his own demons.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10195', 'Thor: The Dark World', 2013, 112, '2013-11-08', 'There are nine realms of Asgard and once every 5,000 years they align. Earth happens to be one of these realms. These realms create portals between the worlds during the alignment which is called \"Convergence\". On Earth, in London, Jane Foster believes she and her crew have discovered one such portal. Foster, while investigating the phenomenon, is transported to another realm and comes in contact with a substance called Aether. Upon coming into contact with the substance, it draws Thor from Asgard back to Earth. Thor takes Jane to Asgard to be cured from the Aether. Unfortunately in doing so it draws more than just Jane to that world. Another being called Malekith wants to use the Aether to destroy Asgard. Devising a plan with his brother - the war criminal Loki, Thor heads to \"The Dark World\" to destroy the Aether and save Asgard. But can Loki be trusted?', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10196', 'Back Country', 2014, 92, '2015-03-20', 'An urban couple go camping in the Canadian wilderness - where unimaginable beauty sits alongside our most primal fears. Alex (Jeff Roop) is a seasoned outdoorsman while Jenn (Missy Peregrym), a corporate lawyer, is not. After much convincing, and against her better judgment, she agrees to let him take her deep into a Provincial Park to one of his favorite spots - the secluded Blackfoot Trail. On their first night, deep in the forest, they have an unsettling encounter with Brad (Eric Balfour), a strange alpha male with eyes for Jenn who may or may not be following them. Alex\'s desire to quickly reach Blackfoot Trail only intensifies. They push further and further into the woods, Alex stubbornly insisting that he remembers the way. After three days their path disappears; they are hopelessly lost. Without food or water, they struggle to find their way back, the harsh conditions bringing out the best and worst in them, pushing their already fragile relationship to the breaking point.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10197', 'Big Hero 6', 2014, 122, '2014-11-07', 'When a devastating event befalls the city of San Fransokyo and catapults Hiro into the midst of danger, he turns to Baymax and his close friends adrenaline junkie Go Go Tomago, neatnik Wasabi, chemistry whiz Honey Lemon and fanboy Fred. Determined to uncover the mystery, Hiro transforms his friends into a band of high-tech heroes called \'Big Hero 6.\'', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10198', 'Captain America: The Winter Soldier', 2014, 136, '2014-04-04', 'For Steve Rogers, awakening after decades of suspended animation involves more than catching up on pop culture; it also means that this old school idealist must face a world of subtler threats and difficult moral complexities. That becomes clear when Director Nick Fury is killed by the mysterious assassin, the Winter Soldier, but not before warning Rogers that SHIELD has been subverted by its enemies. When Rogers acts on Fury\'s warning to trust no one there, he is branded as a traitor by the organization. Now a fugitive, Captain America must get to the bottom of this deadly mystery with the help of the Black Widow and his new friend, The Falcon. However, the battle will be costly for the Sentinel of Liberty, with Rogers finding enemies where he least expects them while learning that the Winter Soldier looks disturbingly familiar.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10199', 'Dracula Untold', 2014, 92, '2014-10-10', 'As his kingdom is being threatened by the Turks, young prince Vlad Tepes must become a monster feared by his own people in order to obtain the power needed to protect his own family, and the families of his kingdom.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10200', 'Dukhtar', 2014, 93, '2014-09-18', 'A 15 year old girl, Allah Rakhi, was married to much older tribal leader Daulat Khan and left Lahore to live on mountains with him. Now, after two decades her 10 year old daughter was engaged with rival tribe leader Tor Gul to settle the dispute between two tribes. But her mother does not want that to happen and flees with her daughter from there to go Lahore.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10201', 'Gone Girl', 2014, 149, '2014-10-03', 'With his wife\'s disappearance having become the focus of an intense media circus, a man sees the spotlight turned on him when it\'s suspected that he may not be innocent.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10202', 'Guardians of the Galaxy', 2014, 121, '2014-08-01', 'A group of intergalactic criminals are forced to work together to stop a fanatical warrior from taking control of the universe.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10203', 'How To Train Your Dragon 2', 2014, 102, '2010-03-26', 'When Hiccup and Toothless discover an ice cave that is home to hundreds of new wild dragons and the mysterious Dragon Rider, the two friends find themselves at the center of a battle to protect the peace.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10204', 'Interstellar', 2014, 169, '2014-11-07', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10205', 'John Wick', 2014, 101, '2014-09-19', 'An ex-hitman comes out of retirement to track down the gangsters that killed his dog and took everything from him.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10206', 'Kingsman: The Secret Service', 2014, 129, '2014-02-13', 'A spy organization recruits an unrefined, but promising street kid into the agency\'s ultra-competitive training program, just as a global threat emerges from a twisted tech genius.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10207', 'Lucy', 2014, 89, '2014-07-25', 'It was supposed to be a simple job. All Lucy had to do was deliver a mysterious briefcase to Mr. Jang. But immediately Lucy is caught up in a nightmarish deal where she is captured and turned into a drug mule for a new and powerful synthetic drug.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10208', 'Predestination', 2014, 97, '2014-08-28', 'An agent must travel back in time to prevent the action of a criminal responsible for an attack that kills thousands of people.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10209', 'Road to Paloma', 2014, 91, '2014-07-11', 'Wolf, a Native American on the run after avenging his mother\'s murder, flees across the desolate American West on his motorcycle, where he\'ll discover that justice has a cost.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10210', 'Saphirblau', 2014, 116, '2014-10-18', 'Gwen has just discovered, that she\'s the final member of the secret time-traveling Circle of Twelve. Now she has to juggle with constant trips to the past, her relationships with Gideon and figuring out dark secrets surrounding the Circle.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10211', 'That Awkward Moment', 2014, 94, '2014-01-31', 'Best pals Jason and Daniel indulge in casual flings and revel in their carefree, unattached lives. After learning that the marriage of their friend Mikey is over, they gladly welcome him back into their circle. The three young men make a pact to have fun and avoid commitment. However, when all three find themselves involved in serious relationships, they must keep their romances secret from one another.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10212', 'The Hobbit: The Battle of the Five Armies', 2014, 144, '2014-12-17', 'Bilbo and Company are forced to engage in a war against an array of combatants and keep the Lonely Mountain from falling into the hands of a rising darkness.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
