('DmZGJg10273', 'Detective Conan Movie 21: Karakurenai no Love Lett', 2017, 111, '2017-04-15', 'A bombing case at Nichiuri TV in autumn. The Satsuki Cup, which crowns the winner of Japan\'s Hyakunin Isshu, is currently being filmed inside the facility. The incident results in a big commotion and, while the building is burning to ashes, the only people left inside are Heiji and Kazuha. They get rescued just in time by Conan, who rushes to the scene. Both the identity and purposes of the bomber are unknown. While confusion takes over due to the explosion, Conan meets a mysterious beautiful girl who claims she is \"Heiji\'s fiancée\". Her name is Momiji Ooka and she is the Kyoto High School champion of the Karuta game. As fate would have it, Kazuha is going to face Momiji in the Hyakunin Isshu, so she begins to train with the help of Heiji\'s mother, Shizuka, who is a skilled Karuta player. At the same time, in a Japanese house in Arashiyama, Kyoto\'s outskirts, the reigning Satsuki Cup champion is murdered. Pictures of the crime scene reveal Momji\'s presence. Additionally, several Karuta cards were spread around the victim. Conan and Heiji, along with the Osaka and Kyoto police departments, begin their investigation on the Satsuki Cup and the related murder case. As the inquiry goes on, they come across a secret connected with the Hyakunin Isshu.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
