('DmZGJg10275', 'Get Out', 2017, 104, '2017-02-24', 'A young African-American visits his white girlfriend\'s parents for the weekend, where his simmering uneasiness about their reception of him eventually reaches a boiling point.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10276', 'Ghost in the Shell', 2017, 107, '2017-03-31', 'In the near future, Major is the first of her kind: A human saved from a terrible crash, who is cyber-enhanced to be a perfect soldier devoted to stopping the world\'s most dangerous criminals.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10277', 'Guardians of the Galaxy Vol. 2', 2017, 137, '2017-04-19', 'The Guardians must fight to keep their newfound family together as they unravel the mysteries of Peter Quill\'s true parentage.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10278', 'Happy Death Day', 2017, 96, '2017-10-13', 'A college student must relive the day of her murder over and over again, in a loop that will end only when she discovers her killer\'s identity.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10279', 'It', 2017, 135, '2017-09-08', 'A group of bullied kids band together when a shapeshifting demon, taking the appearance of a clown, begins hunting children.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10280', 'Jumanji: Welcome to the jungle', 2017, 119, '2017-12-20', 'Four teenagers are sucked into a magical video game, and the only way they can escape is to work together to finish the game..', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10281', 'Justice League', 2017, 110, '2017-11-17', 'Fueled by his restored faith in humanity and inspired by Superman\'s selfless act, Bruce Wayne enlists the help of his newfound ally, Diana Prince, to face an even greater enemy.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10282', 'Kimi No Na Wa (Your Name)', 2017, 106, '2017-04-07', 'Two strangers find themselves linked in a bizarre way. When a connection forms, will distance be the only thing to keep them apart?', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10283', 'Kingsman: The Golden Circle', 2017, 141, '2017-09-22', 'When their headquarters are destroyed and the world is held hostage, the Kingsman\'s journey leads them to the discovery of an allied spy organization in the US. These two elite secret organizations must band together to defeat a common enemy.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10284', 'Pitch Perfect 3', 2017, 93, '2017-12-21', 'After the highs of winning the World Championships, the Bellas find themselves split apart and discovering there aren\'t job prospects for making music with your mouth. But when they get the chance to reunite for an overseas USO tour, this group of awesome nerds will come together to make some music, and some questionable decisions, one last time.\n\n', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10285', 'Raees', 2017, 161, '2017-01-25', 'Threat looms over bootlegger Raees Alam and his business after ACP Majmudar decides to get the better of him. In order to survive and keep his trade thriving, Raees must overcome Majumdar.', '2021-12-31 22:00:00', '2021-12-31 22:00:00');
INSERT INTO `movies` (`id`, `name`, `year`, `runtime`, `releasedate`, `storyline`, `created_at`, `updated_at`) VALUES
('DmZGJg10286', 'Spiderman Homecoming', 2017, 133, '2017-07-05', 'Following the events of Captain America: Civil War, Peter Parker, with the help of his mentor Tony Stark, tries to balance his life as an ordinary high school student in Queens, New York City, with fighting crime as his superhero alter ego Spider-Man as a new threat, the Vulture, emerges.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10287', 'Star Wars: Episode 8 - The Last Jedi', 2017, 150, '2017-12-15', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10288', 'The Dark Tower', 2017, 95, '2017-08-18', 'Roland Deschain (Idris Elba), the last Gunslinger, is locked in an eternal battle with Walter O\'Dim (Matthew McConaughey), also known as the Man in Black. The Gunslinger must prevent the Man in Black from toppling the Dark Tower, the key that holds the universe together. With the fate of worlds at stake, two men collide in the ultimate battle between good and evil.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10289', 'The Disaster Artist', 2017, 104, '2017-12-08', 'When Greg Sestero, an aspiring film actor, meets the weird and mysterious Tommy Wiseau in an acting class, they form a unique friendship and travel to Hollywood to make their dreams come true.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10290', 'The Fate of the Furious', 2017, 136, '2017-04-14', 'A cyberterrorist Cipher lures Dom to work for her and now Dom\'s crew has to stop Cipher while fighting Dom.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10291', 'The Greatest Showman', 2017, 105, '2017-12-08', 'Celebrates the birth of show business and tells of a visionary who rose from nothing to create a spectacle that became a worldwide sensation.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10292', 'The Invisible Man', 2017, 88, '2018-02-08', 'A modern retelling of H.G. Wells classic novel, The Invisible Man. Motivated by the death of his son, Griffin, a brilliant but eccentric scientist discovers a method to invisibility. He is able to complete the experiment, with the aid of his assistant, Faith. The formula allows him to exact revenge on murderer that killed his son, but at a tragic expense, the formula slowly begins to consume his mind.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10293', 'The Mummy', 2017, 110, '2017-06-09', 'An ancient Egyptian princess is awakened from her crypt beneath the desert, bringing with her malevolence grown over millennia, and terrors that defy human comprehension.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10294', 'The Shape of Water', 2017, 123, '2017-12-21', 'From master storyteller Guillermo del Toro comes THE SHAPE OF WATER, an otherworldly fable set against the backdrop of Cold War era America circa 1962. In the hidden high-security government laboratory where she works, lonely Elisa (Sally Hawkins) is trapped in a life of isolation. Elisa\'s life is changed forever when she and co-worker Zelda (Octavia Spencer) discover a secret classified experiment. Rounding out the cast are Michael Shannon, Richard Jenkins, Michael Stuhlbarg, and Doug Jones. Written by Fox Searchlight Pictures\n\n', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10295', 'Thor: Ragnarok', 2017, 137, '2017-10-25', 'Thor is imprisoned on the other side of the universe and finds himself in a race against time to get back to Asgard to stop Ragnarok, the destruction of his homeworld and the end of Asgardian civilization, at the hands of an all-powerful new threat, the ruthless Hela.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10296', 'War of The Planet Of The Apes', 2017, 140, '2017-07-10', 'Caesar and his apes are forced into a deadly conflict with an army of humans led by a ruthless Colonel. After the apes suffer unimaginable losses, Caesar wrestles with his darker instincts and begins his own mythic quest to avenge his kind. As the journey finally brings them face to face, Caesar and the Colonel are pitted against each other in an epic battle that will determine the fate of both their species and the future of the planet.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10297', 'Wonder Woman', 2017, 141, '2017-05-15', 'When a pilot crashes and tells of conflict in the outside world, Diana, an Amazonian warrior in training, leaves home to fight a war, discovering her full powers and true destiny.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10298', 'A Quiet Place', 2018, 91, '2018-04-06', 'In a post-apocalyptic world, a family is forced to live in silence while hiding from monsters with ultra-sensitive hearing.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10299', 'A Star is Born', 2018, 135, '2018-09-07', 'Seasoned musician Jackson Maine (Bradley Cooper) discovers-and falls in love with-struggling artist Ally (Gaga). She has just about given up on her dream to make it big as a singer - until Jack coaxes her into the spotlight. But even as Ally\'s career takes off, the personal side of their relationship is breaking down, as Jack fights an ongoing battle with his own internal demons. Written by Warner Bros.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10300', 'Acrimony', 2018, 120, '2018-03-30', 'Melinda Moore is a steadfast, hardworking wife who supports her husband, Robert Gayle, an engineer trying to sell an innovative battery design. A running total/dwindling balance of the proceeds Melinda receives after her mother\'s death is portrayed as the couple gets in over their heads in debt, which fractures their marriage over time. The film is divided into categories based in the emotional spectrum that Melinda experiences.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10301', 'Annihilation', 2018, 115, '2018-02-23', 'Melinda Moore is a steadfast, hardworking wife who supports her husband, Robert Gayle, an engineer trying to sell an innovative battery design. A running total/dwindling balance of the proceeds Melinda receives after her mother\'s death is portrayed as the couple gets in over their heads in debt, which fractures their marriage over time. The film is divided into categories based in the emotional spectrum that Melinda experiences.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10302', 'Ant-Man and the Wasp', 2018, 118, '2018-07-06', 'As Scott Lang balances being both a Super Hero and a father, Hope van Dyne and Dr. Hank Pym present an urgent new mission that finds the Ant-Man fighting alongside The Wasp to uncover secrets from their past.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10303', 'Aquaman', 2018, 140, '2018-12-14', 'Arthur Curry learns that he is the heir to the underwater kingdom of Atlantis, and must step forward to lead his people and be a hero to the world.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10304', 'Arif v 216', 2018, 125, '2018-01-05', 'After 8 years, Arif\'s old friend 216 from planet GORA pays a visit to Earth.Together they go on a quest where they\'ll be visiting 60\'s.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10305', 'Avengers: Infinity War', 2018, 149, '2018-04-27', 'The Avengers and their allies must be willing to sacrifice all in an attempt to defeat the powerful Thanos before his blitz of devastation and ruin puts an end to the universe.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10306', 'Beautiful Boy', 2018, 120, '2018-10-12', 'Based on the best-selling pair of memoirs from father and son David and Nic Sheff, Beautiful Boy chronicles the heartbreaking and inspiring experience of survival, relapse, and recovery in a family coping with addiction over many years.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10307', 'Bigger', 2018, 107, '2018-10-12', 'The inspirational tale of the grandfathers of fitness as we now know it, Joe and Ben Weider. Facing anti-Semitism and extreme poverty, the brothers beat all odds to build an empire and inspire future generations.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10308', 'Black Panther', 2018, 134, '2018-02-16', 'T\'Challa, heir to the hidden but advanced kingdom of Wakanda, must step forward to lead his people into a new future and must confront a challenger from his country\'s past.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10309', 'Bohemian Rhapsody', 2018, 134, '2018-11-02', 'A chronicle of the years leading up to Queen\'s legendary appearance at the Live Aid (1985) concert.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10310', 'Bumblebee', 2018, 120, '2018-12-21', 'On the run in the year 1987, Bumblebee finds refuge in a junkyard in a small Californian beach town. Charlie, on the cusp of turning 18 and trying to find her place in the world, discovers Bumblebee, battle-scarred and broken.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10311', 'Christopher Robin', 2018, 104, '2018-08-02', 'An adult Christopher Robin, who is now focused on his new life, work, and family, suddenly meets his old friend Winnie the Pooh, who returns to his unforgotten childhood past to help him return to the Hundred Acre Wood and help find Pooh\'s lost friends. Written by Jon Meyer\n\n', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10312', 'Crazy Rich Asians', 2018, 121, '2018-08-15', 'Rachel Chu is happy to accompany her longtime boyfriend, Nick, to his best friend\'s wedding in Singapore. She\'s also surprised to learn that Nick\'s family is extremely wealthy and he\'s considered one of the country\'s most eligible bachelors. Thrust into the spotlight, Rachel must now contend with jealous socialites, quirky relatives and something far, far worse -- Nick\'s disapproving mother.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10313', 'Das schönste Mädchen der Welt', 2018, 102, '2018-09-06', 'Cyril falls head over heel for the new girl in his class. Roxy is drop dead gorgeous and she is cool. But there is a problem. Cyril is terribly self conscious because he\'s got a rather large nose. And while he writes songs for and about his beloved, he is too shy to let her know they are his and pretends they were written by the hunky Rick whom he presumes Roxy must admire. And if he has not chances with the lovely, he\'d rather she go out with dim witted Rick than with that macho Benno.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10314', 'Deadpool 2', 2018, 119, '2018-05-10', 'Foul-mouthed mutant mercenary Wade Wilson (AKA. Deadpool), brings together a team of fellow mutant rogues to protect a young boy with supernatural abilities from the brutal, time-traveling cyborg, Cable.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10315', 'El Ángel', 2018, 126, '2018-11-09', 'The pretty face of Carlos (a 17-year-old teenager) hides a dark side of robbers, lies and murders.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10316', 'Fifty Shades Freed', 2018, 105, '2018-02-09', 'Anastasia and Christian get married, but Jack Hyde continues to threaten their relationship.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10317', 'First Man', 2018, 119, '2018-10-19', 'A look at the life of the astronaut, Neil Armstrong, and the legendary space mission that led him to become the first man to walk on the Moon on July 20, 1969. ', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10318', 'Goosebumps 2: Haunted Halloween', 2018, 100, '2018-10-12', 'Halloween comes to life in a comedy adventure based on R.L. Stine\'s 400-million-selling series of books.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10319', 'Halloween', 2018, 109, '2018-10-19', 'Laurie Strode comes to her final confrontation with Michael Myers, the masked figure who has haunted her since she narrowly escaped his killing spree on Halloween night four decades ago.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10320', 'Hereditary', 2018, 127, '2018-06-08', 'After the family matriarch passes away, a grieving family is haunted by tragic and disturbing occurrences, and begin to unravel dark secrets.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10321', 'Hold the Dark', 2018, 125, '2018-09-28', 'After the deaths of three children suspected to be killed by wolves, writer Russell Core is hired by the parents of a missing six-year-old boy to track down and locate their son in the Alaskan wilderness.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10322', 'Incredibles 2', 2018, 118, '2018-06-14', 'While the Parr family has accepted its collective calling as superheroes, the fact remains that their special heroism is still illegal. After they are arrested after unsuccessfully trying to stop the Underminer, their future seems bleak. However, the wealthy Deavor siblings of Devtech offer new hope with a bold project to rehabilitate the public image and legal status of Supers, with Elastigirl being assigned on point to be the shining example. Now having agreed for now to stay at home to care of the kids, Mr. Incredible finds domestic life a daunting challenge, especially with baby Jack-Jack\'s newly emerged powers making him almost impossible to manage. However, Elastigirl soon has her own concerns dealing with the menace of a new supervillain, Screenslaver, who is wreaking havoc with his mind control abilities. Now, Elastigirl must solve the mystery of this enemy, who has malevolent designs on the world with the Parr family and friends key targets of this evil. Written by Kenneth Chisholm (kchishol@rogers.com)\n\n', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10323', 'Isle of Dogs', 2018, 101, '2018-02-15', 'Set in Japan, Isle of Dogs follows a boy\'s odyssey in search of his lost dog.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10324', 'Johnny English Strikes Again', 2018, 88, '2018-10-26', 'JOHNNY ENGLISH STRIKES AGAIN is the third installment of the Johnny English comedy series, with Rowan Atkinson returning as the much loved accidental secret agent.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10325', 'Jurassic World: Fallen Kingdom', 2018, 130, '2018-05-21', 'A small team of mercenaries arrives on the abandoned Isla Nublar to collect DNA from the remains of the Indominus rex at the bottom of the park\'s lagoon. After successfully collecting a bone fragment, the team\'s survivors barely escape the island following attacks by the Mosasaurus and Tyrannosaurus rex', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10326', 'Love, Simon', 2018, 110, '2018-04-05', 'Simon Spier keeps a huge secret from his family, his friends and all of his classmates: he\'s gay. When that secret is threatened, Simon must face everyone and come to terms with his identity.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10327', 'Mary Poppins Returns', 2018, 145, '0000-00-00', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10328', 'Maze Runner: The Death Cure', 2018, 143, '2018-01-26', 'Young hero Thomas embarks on a mission to find a cure for a deadly disease known as \'The Flare\'', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10329', 'Mid90s', 2018, 84, '2018-10-19', 'The movie follows a teenager named Stevie growing up in Los Angeles. He\'s struggling with his family, including his co-dependent single mom and his abusive older brother, and at school, where his richer friends seem to overlook him. When Stevie befriends a crew of skateboarders, he learns some tough lessons about class, race, and privilege. Written by Polly_Kat.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10330', 'Mission: Impossible - Fallout', 2018, 148, '2018-05-10', 'Two years after Ethan Hunt had successfully captured Solomon Lane, the remnants of the Syndicate have reformed into another organization called the Apostles. Under the leadership of a mysterious fundamentalist known only as John Lark, the organization is planning on acquiring three plutonium cores. Ethan and his team are sent to Berlin to intercept them, but the mission fails when Ethan saves Luther and the Apostles escape with the plutonium. With CIA agent August Walker joining the team, Ethan and his allies must now find the plutonium cores before it\'s too late', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10331', 'Mortal Engines', 2018, 125, '2018-12-14', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10332', 'Ocean\'s 8', 2018, 111, '2018-06-08', 'Debbie Ocean gathers an all-female crew to attempt an impossible heist at New York City\'s yearly Met Gala.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10333', 'Overlord', 2018, 0, '2018-10-26', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10334', 'Pacific Rim: Uprising', 2018, 111, '2018-04-21', 'Jake Pentecost, son of Stacker Pentecost, reunites with Mako Mori to lead a new generation of Jaeger pilots, including rival Lambert and 15-year-old hacker Amara, against a new Kaiju threat.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10335', 'Paul, Apostle of Christ', 2018, 106, '2018-03-23', 'The film tells the story of Paul, who was known as a ruthless persecutor of Christians prior to his conversion to Christianity. The plot focuses on his becoming a pivotal figure in the formation of the early church before being executed by Emperor Nero in Rome.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10336', 'Petta', 2018, 120, '2018-12-12', 'Bashaa Returns', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10337', 'Ralph Breaks the Internet', 2018, 142, '2018-11-21', '', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10338', 'Rampage', 2018, 107, '2018-04-13', 'Primatologist Davis shares an unshakable bond with George, the extraordinarily intelligent silverback gorilla who has been in his care since he was young. When a greed-fueled corporation\'s genetic experiment goes awry, George and other animals across the country are mutated into aggressive supercreatures who destroy everything in their path. In this adrenaline-filled ride, Davis tries to find an antidote, not only to halt a global catastrophe but also to save the fearsome creature who was once his friend.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10339', 'Ready Player One', 2018, 140, '2018-03-11', 'When the creator of a virtual reality world called the OASIS dies, he releases a video in which he challenges all OASIS users to find his Easter Egg, which will give the finder his fortune. ', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10340', 'Searching', 2018, 112, '2018-08-31', 'After his 16-year-old daughter goes missing, a desperate father breaks into her laptop to look for clues to find her.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10341', 'Skyscraper', 2018, 102, '2018-07-01', 'A security expert must infiltrate a burning skyscraper, 225 stories above ground, when his family are trapped inside by criminals. ', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10342', 'Smallfoot', 2018, 96, '2018-09-27', 'A Yeti is convinced that the elusive creatures known as \"humans\" really do exist.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10343', 'Solo: A Star Wars Story', 2018, 135, '2018-05-24', 'During an adventure into the criminal underworld, Han Solo meets his future co-pilot Chewbacca and encounters Lando Calrissian years before joining the Rebellion.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10344', 'The Happy Prince', 2018, 105, '2018-10-05', 'The untold story of the last days in the tragic times of Oscar Wilde, a person who observes his own failure with ironic distance and regards the difficulties that beset his life with detachment and humor.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10345', 'The Hate U Give', 2018, 132, '2018-10-19', 'Starr witnesses the fatal shooting of her childhood best friend Khalil at the hands of a police officer. Now, facing pressures from all sides of the community, Starr must find her voice and stand up for what\'s right.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10346', 'The House with a Clock in Its Walls', 2018, 105, '2018-09-21', 'A young orphan named Lewis Barnavelt aids his magical uncle in locating a clock with the power to bring about the end of the world.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10347', 'The Kindergarten Teacher', 2018, 96, '2018-10-12', 'A kindergarten teacher in New York becomes obsessed with one of her students who she believes is a child prodigy.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10348', 'The Meg', 2018, 113, '2018-08-10', 'After escaping an attack by what he claims was a 70-foot shark, Jonas Taylor must confront his fears to save those trapped in a sunken submersible.\nFive years ago, expert sea diver and Naval Captain Jonas Taylor encountered an unknown danger in the unexplored recesses of the Mariana Trench that forced him to abort his mission and abandon half his crew. Though the tragic incident earned him a dishonorable discharge, what ultimately cost him his career, his marriage and any semblance of honor was his unsupported and incredulous claims of what caused it - an attack on his vessel by a mammoth, 70-foot sea creature, believed to be extinct for more than a million years. But when a submersible lies sunk and disabled at the bottom of the ocean - carrying his ex-wife among the team onboard - he is the one who gets the call. Whether a shot at redemption or a suicide mission, Jonas must confront his fears and risk his own life and the lives of everyone trapped below on a single question: Could the Carcharodon Megalodon - the largest marine predator that ever existed - still be alive ... and on the hunt?', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10349', 'The Nun', 2018, 96, '2018-09-07', 'When a young nun at a cloistered abbey in Romania takes her own life, a priest with a haunted past and a novitiate on the threshold of her final vows are sent by the Vatican to investigate. Together they uncover the order\'s unholy secret. Risking not only their lives but their faith and their very souls, they confront a malevolent force in the form of the same demonic nun that first terrorized audiences in \'The Conjuring 2,\' as the abbey becomes a horrific battleground between the living and the damned. Written by Warner Bros.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
('DmZGJg10350', 'The Predator', 2018, 107, '2018-09-14', 'When a young boy accidentally triggers the universe\'s most lethal hunters\' return to Earth, only a ragtag crew of ex-soldiers and a disgruntled scientist can prevent the end of the human race.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
