('DmZGJg10373', 'Hellboy', 2019, 121, '2019-04-09', 'Hellboy is a supernatural being who is the son of a fallen angel. He came to our world in 1944 as a result of a mystical ritual. The Occultists of the Third Reich had long tried to gain an advantage in the war, hoping to attract the ideal soldier to the ranks of the fascist army. Hellboy was exactly the one they needed, but they never managed to make their plans a reality. The demon from hell fell into the hands of Americans and began to serve them, protecting the world from mysterious threats. This time he is sent to England to meet face to face with Merlin\'s wife. Just a battle with the Blood Queen will lead to the end of the world, which the monster tried to avoid all his life.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
