('DmZGJg10399', 'Shirley', 2019, 107, '2019-07-09', 'As renowned for her morose nature as she is for her horror fiction, writer Shirley Jackson (Elizabeth Moss) is crafting yet another masterpiece when the arrival of newlyweds Fred and Rose disrupt her creative process and marriage to literary critic - and philandering professor - Stanley Hyman (Michael Stuhlbarg). As Stanley spars to maintain academic dominance over his would-be protégé Fred, Rose attempts to dampen her own ambitions and adjust to married life while living under the roof of their fiery intellectual hosts with quicksilver loyalties and myriad neuroses. When the motives of Shirley\'s literary muse prove elusive, Rose\'s curiosity and trusting nature make her tender prey for a brilliant author whose only allegiance is to her work.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
