('DmZGJg10401', 'Black Widow', 2021, 134, '2021-07-09', 'Natasha Romanoff, aka Black Widow, confronts the darker parts of her ledger when a dangerous conspiracy with ties to her past arises. Pursued by a force that will stop at nothing to bring her down, Natasha must deal with her history as a spy, and the broken relationships left in her wake long before she became an Avenger.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
