('DmZGJg10404', 'Raya and the Last Dragon', 2021, 124, '2021-03-04', 'Long ago, in the fantasy world of Kumandra, humans and dragons lived together in harmony. However, when sinister monsters known as the Druun threatened the land, the dragons sacrificed themselves to save humanity. Now, 500 years later, those same monsters have returned, and it\'s up to a lone warrior to track down the last dragon and stop the Druun for good.', '2021-12-31 22:00:00', '2021-12-31 22:00:00'),
